'use strict';
let HeartbeatMessage = require('./HeartbeatMessage.js');
let variantCast = require('@gehtsoft/LuaxStdlib-node').variantCast;
class HeartbeatMessageBuilder extends HeartbeatMessage {
    setNumberOfSubscribedSymbols(numberOfSubscribedSymbolsStr) {
        this.numberOfSubscribedSymbols = variantCast.castToInt(variantCast.fromString(numberOfSubscribedSymbolsStr));
    }
    setSubscribedSymbolsCheckSum(subscribedSymbolsCheckSum) {
        this.subscribedSymbolsCheckSum = subscribedSymbolsCheckSum;
    }
    setRequestId(requestId) {
        this.requestId = requestId;
    }
    build() {
        return this;
    }
}
module.exports = HeartbeatMessageBuilder
